import React from "react";
import {
  Background,
  ModalWrapper,
  ModalCotent,
  CloseModal,
} from "../../../styledComponents/Dashboard/Modals/createTransactionModal";
const CreateTransaction = ({ state, setState }) => {
  const modalstate = state.showModal;
  return (
    <div>
      {state.showModal ? (
        <Background>
          <ModalWrapper state={state}>
            <ModalCotent>Hello World</ModalCotent>
            <CloseModal
              onClick={() => {
                setState((prevstate) => ({
                  ...prevstate,
                }));
              }}
            >
              &times;
            </CloseModal>
          </ModalWrapper>
        </Background>
      ) : null}
    </div>
  );
};

export default CreateTransaction;
